e type'=>'Naložena vrsta datoteka ni v dovoljenem formatu','Uploading a file fails for any reason'=>'Nalaganje datoteke ne uspe iz kakršnega koli razloga','Max'=>'Max','Min'=>'Min','Range'=>'Razpon','Use this text as the placeholder of the field'=>'Uporabi to besedilo kot vsebnik polja','Default value'=>'Privzeta vrednost','Date field'=>'Datumsko polje','https://contactform7.com/date-field/'=>'https://contactform7.com/date-field/','Generate a form-tag for a date input field. For more details, see %s.'=>'Ustvari oznako obrazca za polje za vnos besedila z več vrstami. Za več podrobnosti glejte %s.','date'=>'datum','Date is later than maximum limit'=>'Datum je po obdobju nastavljene maksimalne meje','Date is earlier than minimum limit'=>'Datum je iz obdobja pred nastavljeno minimalno mejo','Date format that the sender entered is invalid'=>'Oblika datuma, ki jo je vpisal pošiljatelj, ni veljavna','To use the value input through this field in a mail field, you need to insert the corresponding mail-tag (%s) into the field on the Mail tab.'=>'Če želite uporabiti vhodno vrednost s tem poljem v poštnem polju, morate vnesti ustrezno poštno oznako (%s) V polje na kartici Mail.','Make checkboxes exclusive'=>'Naj bo potrditveno polje ekskluzivno?','Wrap each item with label element'=>'Vsak element zavijte z elementom oznake','Put a label first, a checkbox last'=>'Naj bo najprej naziv in potem potrditveno polje?','One option per line.'=>'Ena možnost na vrstico','Required field'=>'Zahtevano polje','Field type'=>'Vrsta polja','Checkboxes, radio buttons and menus'=>'Gumbi, radijske tipke in meniji','https://contactform7.com/checkboxes-radio-buttons-and-menus/'=>'https://contactform7.com/checkboxes-radio-buttons-and-menus/','Generate a form-tag for a group of radio buttons. For more details, see %s.'=>'Ustvari oznako za skupino radijskih gumbov. Za več podrobnosti glejte %s.','Generate a form-tag for a group of checkboxes. For more details, see %s.'=>'Generiraj form-značke za skupino potrditvenih polj. Za podrobnosti glej %s.','radio buttons'=>'Radio stikala','checkboxes'=>'potrditvena polja','This contact form contains CAPTCHA fields, but the necessary libraries (GD and FreeType) are not available on your server.'=>'Kontaktni obrazec vsebuje CAPTCHA polja, vendar pa knjižnic ki jih potrebuje  (GD in FreeType) ni moč zaznati oz. najti na vašem strežniku.','This contact form contains CAPTCHA fields, but the temporary folder for the files (%s) does not exist or is not writable. You can create the folder or change its permission manually.'=>'Kontaktni obrazec vsebuje CAPTCHA polja, vendar začasna mapo za datoteke (%s) ne obstaja ali pa ni zapisljiva. Ustvarite mapo ali ročno spremenite dovoljenja mape.','Input field settings'=>'Nastavitev vnosnega polja','Image settings'=>'Nastavitve slike','https://contactform7.com/captcha/'=>'https://contactform7.com/captcha/','Generate form-tags for a CAPTCHA image and corresponding response input field. For more details, see %s.'=>'Generiraj form-značke za CAPTCHA sliko ter ustrezno vnosno polje. Za podrobnosti glej %s.','To use CAPTCHA, you first need to install and activate %s plugin.'=>'Za uporabo CAPTCHA moraš najprej namestiti in aktivirati vtičnik %s.','CAPTCHA'=>'CAPTCHA','Your entered code is incorrect.'=>'Vaša vnešena koda ni pravilna.','The code that sender entered does not match the CAPTCHA'=>'Koda ki jo je vnesel pošiljatelj se ne ujema s CAPTCHA','Insert Tag'=>'Vstavi značko','Class attribute'=>'Class atribut','Id attribute'=>'Atribut ID','Options'=>'Nastavitve','Name'=>'Ime','Acceptance checkbox'=>'Potrditveno polje za sprejem','https://contactform7.com/acceptance-checkbox/'=>'https://contactform7.com/acceptance-checkbox/','Generate a form-tag for an acceptance checkbox. For more details, see %s.'=>'Generiraj form-značko za potrditveno polje sprejema. Za podrobnosti glej %s.','acceptance'=>'sprejem','<code>%1$s</code> property of a <code>WPCF7_ContactForm</code> object is <strong>no longer accessible</strong>. Use <code>%2$s</code> method instead.'=>'<code>%1$s</code> lastnost <code>WPCF7_ContactForm</code> predmeta <strong>ni več na voljo</strong>. Namesto tega uporabite <code>%2$s</code>.','Untitled'=>'Neimenovan','Contact Form'=>'Kontaktni obrazec','There is a field with input that is shorter than the minimum allowed length'=>'Obstaja polje, kjer je uporabnik ni dosegel minimalne zahtevane dolžine vnosa','There is a field with input that is longer than the maximum allowed length'=>'Obstaja polje, kjer je uporabnik presegel dovoljeno dolžino vnosa','There is a field that the sender must fill in'=>'Obstaja polje, ki ga pošiljatelj mora izpolniti','There are terms that the sender must accept'=>'Obstajajo pogoji,  ki jih pošiljatelj mora sprejeti','Submission was referred to as spam'=>'Pošiljanje je bilo označeno kot neželjeno (spam) sporočilo','Validation errors occurred'=>'Prišlo je do napake pri preverjanju veljavnosti obrazca','Sender\'s message failed to send'=>'Pošiljateljevo sporočilo ni bilo uspešno poslano','Sender\'s message was sent successfully'=>'Pošiljateljevo sporočilo je bilo uspešno poslano','Message Body:'=>'Sporočilo:','Subject: %s'=>'Zadeva: %s','From: %s'=>'Od: %s','Send'=>'Pošlji','Your message'=>'Vaše sporočilo','Your email'=>'Vaša e-pošta','Your name'=>'Vaše ime','Form-tag Generator: %s'=>'Generator Form-značk: %s','For more information:'=>'Za več informacij:','Any information you provide will not be shared with service providers without your authorization.'=>'Nobena informacija ne bo deljena s ponudnikom storitve brez tvoje avtorizacije.','You may need to first sign up for an account with the service that you plan to use. When you do so, you would need to authorize Contact Form 7 to access the service with your account.'=>'Pred uporabo servisa, ki ga nameravaš uporabljat, se moraš naprej prijavit v račun. Nato s svojim računom avtoriziraš Contact Form 7 za dostop do servisa.','On this screen, you can manage services that are available through Contact Form 7. Using API will allow you to collaborate with any services that are available.'=>'Na dotičnemu zaslonu lahko upravljaš storitve, ki so na voljo preko Contact Form 7. Z uporabo API vmesnika, lahko sodeluješ s katerimkoli servisom, ki je na voljo.','A mail-tag is also a short code enclosed in square brackets that you can use in every Mail and Mail (2) field. A mail-tag represents a user input value through an input field of a corresponding form-tag.'=>'Poštna oznaka je prav tako kratka koda zaprta v oglate oklepaje in jo lahko uporabite v vsakem Pošta in Pošta (2) polju. Poštna oznaka (mail-tag) predstavlja vrednost vnosa preko vnosnega polja pripadajoče oznake obrazca (form-tag)','A form-tag is a short code enclosed in square brackets used in a form content. A form-tag generally represents an input field, and its components can be separated into four parts: type, name, options, and values. Contact Form 7 supports several types of form-tags including text fields, number fields, date fields, checkboxes, radio buttons, menus, file-uploading fields, CAPTCHAs, and quiz fields.'=>'Obrazec-oznaka (form-tag) je kratka koda, zaprto v oglate oklepaje, ki se uporablja v vsebini obrazca. Oznaka obrazca običajno predstavlja vnosno polje katerega sestavni deli se lahko ločijo na štiri dele: vrsta, ime, možnosti in vrednosti. Contact Form 7 podpira več vrst oznak obrazca vključno z besedilnimi polji, številčna poljaj, polja z datumom, potrditvena polja, radio gumbi, meniji, CAPTCHA, polja za nalaganje datotek in kviz polja.','<strong>Additional Settings</strong> provides a place where you can customize the behavior of this contact form by adding code snippets.'=>'<strong>Dodatne nastavitve</strong> prostor kjer lahko prilagodite delovanje tega obrazca z dodajanjem kode.','In <strong>Messages</strong>, you can edit various types of messages used for this contact form. These messages are relatively short messages, like a validation error message you see when you leave a required field blank.'=>'V <strong>Sporočilih,</strong> lahko urejate različne vrste sporočil, ki se uporabljajo za ta kontaktni obrazec. Ta sporočila so kratka sporočila, kot  je naprimer sporočilo o napaki, ki se prikaže, ko pustite zahtevano polje prazno.','<strong>Mail (2)</strong> is an additional mail template that works similar to Mail. Mail (2) is different in that it is sent only when Mail has been sent successfully.'=>'<strong>Pošta (2)</strong> je dodatna poštna predloge, ki deluje podobno kot Pošta. Pošta (2) se razlikuje v tem, da se pošlje le, ko je bila Pošta uspešno poslana.','<strong>Mail</strong> manages a mail template (headers and message body) that this contact form will send when users submit it. You can use Contact Form 7&#8217;s mail-tags here.'=>'<strong>Pošta</strong> upravlja poštno predlogo (glave in telo sporočila), ki bo poslana s tem kontaktnim obrazcem, ki jo pošlje uporabniki. Tu lahko uporabite poštne-oznake Kontaktnega obrazca 7’','<strong>Form</strong> is a content of HTML form. You can use arbitrary HTML, which is allowed inside a form element. You can also use Contact Form 7&#8217;s form-tags here.'=>'<strong>Obrazec</strong> je HTML vsebina obrazca. Uporabite lahko poljubni HTML, ki je dovoljen znotraj elementa obrazca. Tu lahko uporabite Contact Form 7 oznake obrazca (form-tags)','<strong>Title</strong> is the title of a contact form. This title is only used for labeling a contact form, and can be edited.'=>'<strong>Naslovno ime</strong> je ime kontaktnega obrazca. To ime se uporablja samo za označevanje kontaktnega obrazca in ga lahko urejate.','On this screen, you can edit a contact form. A contact form is comprised of the following components:'=>'V tem oknu lahko uredite kontaktni obrazec. Kontaktni obrazec je sestavljen iz naslednjih komponent:','<strong>Duplicate</strong> - Clones that contact form. A cloned contact form inherits all content from the original, but has a different ID.'=>'<strong>Podvoji</strong> - Klonira ta kontaktni obrazec. Kloniran kontaktni obrazec podeduje vso vsebino originala ima le drug ID.','<strong>Edit</strong> - Navigates to the editing screen for that contact form. You can also reach that screen by clicking on the contact form title.'=>'<strong>Urejanje</strong> - Vas vodi na okno urejanja kontaktnega obrazca. To okno lahko odprete tudi tako, da kliknete na ime kontaktnega obrazca.','Hovering over a row in the contact forms list will display action links that allow you to manage your contact form. You can perform the following actions:'=>'S postavitvijo kazalca na vrstico v seznamu kontaktnih obrazcev se vam prikažejo povezana dejanja, ki vam omogočajo upravljanje s kontaktnim obrazcem. Na voljo so vam sledeča dejanja:','On this screen, you can manage contact forms provided by Contact Form 7. You can manage an unlimited number of contact forms. Each contact form has a unique ID and Contact Form 7 shortcode ([contact-form-7 ...]). To insert a contact form into a post or a text widget, insert the shortcode into the target.'=>'V tem oknu lahko upravljate kontaktne obrazce, ki jih zagotavlja Kontaktni obrazec 7. Lahko upravljate neomejeno število kontaktnih obrazcev. Vsak kontaktni obrazec ima edinstveno ime in kratko kodo ([contact-form-7 ...]). Če želite vstaviti kontaktni obrazec v objavo ali besedilni gradnik, vstavite kratko kodo v ustrezno mesto.','Mail-tags'=>'Pošta-oznake','Form-tags'=>'Obrazec-oznake','Available Actions'=>'Razpoložljiva dejanja','Overview'=>'Pregled','You can add customization code snippets here. For details, see %s.'=>'Tu lahko dodaš dodatne snippet kode po lastni meri. Za podrobnosti glej %s.','https://contactform7.com/additional-settings/'=>'https://contactform7.com/additional-settings/','File attachments'=>'Priloge datotek','Use HTML content type'=>'Uporabite HTML vrsto vsebine','Exclude lines with blank mail-tags from output'=>'Izhod naj izključi vrstice s praznimi mail-oznakami','Message body'=>'Telo sporočila','Additional headers'=>'Dodatne glave','Subject'=>'Zadeva','From'=>'Od','To'=>'Za','In the following fields, you can use these mail-tags:'=>'V nasljednjem polju lahko uporabite te mail-oznake:','Mail (2) is an additional mail template often used as an autoresponder.'=>'Pošta (2) je dodatna poštna predloga, pogosto uporabljana kot samodejni odgovor.','Use Mail (2)'=>'Uporabi Pošto (2)','Mail (2)'=>'Pošta (2)','Y/m/d'=>'Y/m/d','Edit &#8220;%s&#8221;'=>'Uredi “%s”','Edit'=>'Uredi','Date'=>'Datum','Author'=>'Avtor','Shortcode'=>'Kratka-koda','Title'=>'Naslov','Additional Settings'=>'Dodatne nastavitve','Additional Settings (%d)'=>'Dodatne nastavitve (%d)','Messages'=>'Sporočila','Mail'=>'Pošta','Form'=>'Obrazec','Support'=>'Podpora','https://contactform7.com/support/'=>'http://contactform7.com/support/','FAQ'=>'PZV (FAQ)','https://contactform7.com/faq/'=>'https://contactform7.com/faq/','Docs'=>'Dokumentacija','https://contactform7.com/docs/'=>'http://contactform7.com/docs/','You are about to delete this contact form.
