\'Prekliči\' za preklic izbrisa ali \'OK\' za potrditev izbris.','Delete'=>'Izbriši','Duplicate'=>'Podvoji','Status'=>'Stanje','You can also use this old-style shortcode:'=>'Lahko uporabite tudi to starokopitno shortcodo.','Copy this shortcode and paste it into your post, page, or text widget content:'=>'Kopiraj dotično kodo ter jo prilepi v svoj prispevek, stran ali v vsebino tekstovnega widgeta.','Enter title here'=>'Tukaj vnesi naslov','Save'=>'Shrani','You are not allowed to edit this contact form.'=>'Za urejanje tega kontaktnega obrazca nimate dovoljenj','https://contactform7.com/save-submitted-messages-with-flamingo/'=>'https://contactform7.com/save-submitted-messages-with-flamingo/','https://contactform7.com/spam-filtering-with-akismet/'=>'https://contactform7.com/spam-filtering-with-akismet/','Setting up mail'=>'Nastavitev pošte','https://contactform7.com/setting-up-mail/'=>'https://contactform7.com/setting-up-mail/','https://contactform7.com/donate/'=>'https://contactform7.com/donate/','Contact Form 7 needs your support.'=>'Contact Form 7 potrebuje vašo podporo','Dismiss'=>'Opusti','<strong>Contact Form 7 %1$s requires WordPress %2$s or higher.</strong> Please <a href="%3$s">update WordPress</a> first.'=>'<strong>Contact Form 7%1$s zahteva Wordpress %2$s ali višjo različico.</strong> Prosimo, da najprej <a href="%3$s">posodobite WordPress</a>.','Settings'=>'Nastavitve','Contact form deleted.'=>'Kontaktni obrazec izbrisan.','Contact form saved.'=>'Kontaktni obrazec shranjen.','Contact form created.'=>'Kontaktni obrazec ustvarjen.','Search Contact Forms'=>'Išči kontaktne obrazce','Search results for &#8220;%s&#8221;'=>'Iskalni rezultat za “%s”','The changes you made will be lost if you navigate away from this page.'=>'Spremembe, ki ste jih naredili bodo izgubljene, če zapustite to stran.','Error in deleting.'=>'Napaka pri brisanju.','You are not allowed to delete this item.'=>'Nimate zadostnih dovoljenj za izbris te postavke.','You are not allowed to edit this item.'=>'Nimate dovoljenja za urejanje te postavke.','Integration'=>'Integracija','Add New'=>'Dodaj nov','Add New Contact Form'=>'Dodaj nov kontaktni obrazec','Contact Forms'=>'Kontaktni obrazci','Edit Contact Form'=>'Uredi kontaktni obrazec','Contact'=>'Stik','Contact Form 7'=>'Contact Form 7']];